import React from 'react';
import MenuItem from '../menu-items/menu-items.componenta';
import './directory.style.css';



class Directory extends React.Component{
    constructor () {
  super();
 
  this.state = {
      sections :[
          {title: 'HATS',
          imageSrc : '../images/hats/3.jpg' ,
          id:1},
      
          {title: 'JACKETS',
          imageSrc : '../images/jackets/3.jpg',
          id:2},

         {title: ' SNEAKERS',
         imageUrl :'../images/shoes/2.jpg',
         id:3},
         
         {title: 'MEN',
          imageUrl : '../images/models/1' ,
          size:'large',
          id:4},
         
         {title: 'WOMEN',
         imageUrl : '../images/models/4',
         size:'large',
         id:5}
        ] 
       }

 }
 render(){
     return(
        <div className ='directory-menu'>
            {
                this.state.sections.map(({title,imageSrc,id,size}) => (
                <MenuItem key={id} title={title} imageSrc={imageSrc} size ={size}/>
            
            ))}
        </div>
     )
 }

}
export default Directory;
